import { Link } from "react-router-dom";
import "./Navbar.css";
const textStyle = {
  textalign: "left",
};
const Navbar = () => {
  return (
    <>
      <div className="navbar-container">
        {/* keep climbing */}
        <Link to="/">home</Link>
        <Link to="/about">about</Link>
        <Link to="/mappage">map</Link>
      </div>
    </>
  );
};

export default Navbar;
